import {getLogger} from "../core";
import {TrainProps} from "./TrainProps";
import axios from 'axios';

const log = getLogger('trainsAPI');

const baseURL = 'http://localhost:3000';

export const getTrains: () => Promise<TrainProps[]> = () =>{
    log("Trying to GET trains...");
    return axios
        .get(`${baseURL}/train`)
        .then(res => {
            log('Yaaaaay we could GET our trains');
            return Promise.resolve(res.data);
        })
        .catch(err => {
            log("Error GETting trains - sad reacts only");
            return Promise.reject(err);
        });
};
